function Product({ item }, props) {
  const images1 = item.map(({ images1 }) => images1);
  const itemName = item.map(({ item_name }) => item_name);
  console.log(itemName);

  return (
    <div className="item-grid">
      {images1.map(({ front }) => {
        return (
          <>
            <a href={`/shop/${item.category}`}>
              <img key={id} src={front} alt={item.item_name} />
            </a>
            {id === id ? <p key={id}>{itemName}</p> : null}
            <button id="sub-btn" onClick="">
              add to cart
            </button>
          </>
        );
      })}
    </div>
  );
}
export default Product;
